   @WebMethod
   public  String getPatientReport(String crNo,String reqDno,String hosCode) throws IOException
   {
		String filename=FetchReportUTL.getReportFileName( crNo, null, reqDno, hosCode);
	    
		String isPortal = "";
		byte[] byteArray;
		
		if(filename=="" || filename==null)
	    	  return null;
	    else{
	      
	    	byte[] byteArr = getReport(filename);
	    	
	    	isPortal = FetchReportUTL.getPortalVal(hosCode);
	    	
	    	//System.out.println("isPortal : "+isPortal);
	    	
	    	if(isPortal.equalsIgnoreCase("1"))
	    		byteArray = addHeader(byteArr);
	    	else
	    		byteArray = byteArr;
	    	
	    	String base64EncodedString = org.apache.commons.codec.binary.Base64.encodeBase64String(byteArray);
	    	
	    	//byteArrayToFile(base64EncodedString);
	    	return base64EncodedString;
	    }
   }
	
   
	private  byte[] getReport(String filename) throws IOException
	{
		byte[] byteArray=null;
         
		byteArray=MongoXmlHandler.getInstance().latestFetchFile(filename);	 
    	
	    return byteArray;
	}
	
	public  byte[] addHeader(byte[] byteArray){
		
		//System.out.println("Add Header to Reports.");
		
		PdfReader reader=null;
		PdfStamper stamp =null;
		ByteArrayOutputStream output = new ByteArrayOutputStream();
		//HttpSession session=request.getSession();
		
		try
		{
			reader=new PdfReader(byteArray);
			int n = reader.getNumberOfPages();
			//stamp = new PdfStamper(reader, new FileOutputStream("E:/out1.pdf"));
			stamp = new PdfStamper(reader, output);
			
			
			int i = 1;
		    PdfContentByte under;
		    PdfContentByte over;
		     
		     //Image img = Image.getInstance(session.getServletContext().getRealPath(InvestigationConfig.WATERMARK_IMAGE_FOR_DUPLICATE_REPORT_PRINTING));
		     
		     //img.setBackgroundColor(Color.white);		      
		      BaseFont bf = BaseFont.createFont(BaseFont.HELVETICA,BaseFont.WINANSI, BaseFont.EMBEDDED);
		      
		     //changed by ashu
		     //Image img = Image.getInstance(InvWebSserviceConfig.IMAGE_FOR_HEADER);
		      Image img=null;
		      
		      
		      String osType = System.getProperties().getProperty("os.name");
		     // System.out.println(" osType : "+osType); 
				if(osType.startsWith("Win")){
					img=Image.getInstance(InvWebSserviceConfig.IMAGE_FOR_HEADER_WINDOWS);
				}else{
					
					img=Image.getInstance(InvWebSserviceConfig.IMAGE_FOR_HEADER_LINUX);
				}

		      
		      img.setAbsolutePosition(20, 745);
		      
		     //img.setAbsolutePosition(20, 735);
		     
		    // System.out.println(" i : "+i+" n : "+n);
		
		      while (i <= n) 
		      {
		    	  
		    	  over = stamp.getOverContent(i);
		          over.beginText();
		          over.setFontAndSize(bf, 11);
		          over.setTextMatrix(30, 30);
		         // over.showText("page " + i +" of "+ n);
		          String ove="Page " + i +" of "+ n;
		          //over.setFontAndSize(bf, 25);
		       
		          over.showTextAligned(Element.ALIGN_BOTTOM, ove, 250f, 30f, 0f);
		          
		          over.addImage(img);  
		          over.setColorFill(new Color(0xC0, 0xC0, 0xC0));
		          over.setFontAndSize(BaseFont.createFont(BaseFont.HELVETICA, BaseFont.WINANSI, false), 54);
		          //over.showTextAligned(Element.ALIGN_CENTER, "Nizam's Institute of Medical Sciences", 350f, 500f, 0f);
		          //over.showTextAligned(Element.ALIGN_CENTER, "Nizam's Institute of Medical Sciences", 350f,800f, 0f);
		         // over.showTextAligned(arg0, arg1, arg2, arg3, arg4);
		          over.endText();
		       // over.endMarkedContentSequence();
		        // Watermark under the existing page
		            
		        /*  under = stamp.getUnderContent(i);  
		        under.addImage(img);  
		        under.setColorFill(new Color(0xC0, 0xC0, 0xC0));
		        under.setFontAndSize(BaseFont.createFont(BaseFont.HELVETICA, BaseFont.WINANSI, false), 54);*/
		        
		        
		        //under.showTextAligned(Element.ALIGN_CENTER, "Duplicate Report", 295f, 552f, 40f);
		        
		        // Text over the existing page under.showTextAlignedKerned(alignment, text, x, y, rotation);
		        over = stamp.getOverContent(i);
		        over.beginText();       
		        over.setFontAndSize(bf, 18); 
		        over.endText();    
		        i++;
		      }
		    
		      stamp.setFormFlattening(true);
		      stamp.close();
		
			}
	catch (Exception e) {
		// TODO: handle exception
		e.printStackTrace();
		
	}
	finally
	{
		
			if(reader!=null){
				reader.close();
			}
			if(stamp!=null){
				try {
					stamp.close();
				} catch (DocumentException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		
	}
		
		return output.toByteArray();
		//return byteArray;
	}
	
	//check pdf save convert string to bytearray thn to pdf
	public void byteArrayToFile(String name) {  
	    try { 
	    	//name = "";
	        // Create file  
	    	String path="E:/";
	    	String path1=path+name;
	    	String finalpath=path1+".pdf";
	    	
	    	byte[] bytearray=org.apache.commons.codec.binary.Base64.decodeBase64(name);
	        OutputStream out = new FileOutputStream("E:/out.pdf");
	        out.write(bytearray);
	        out.close();  
	    } catch (Exception e) {  
	        System.err.println("Error: " + e.getMessage());  
	    }  
	}
	
	
